import React from "react";

function Tile(props) {
  console.log(props);
  return (
    <div
      className="tile"
      style={{
        backgroundColor: "orange"
      }}
    >
      <div className="title">RRWOP</div>
      <div className="number">15</div>
    </div>
  );
}

export default Tile;
